import React from 'react'

const DUMMY_EVENTS = [
  {
    id: 'e1',
    title: 'Event 1'
  },
  {
    id: 'e2',
    title: 'Event 2'
  }
]

export default function EventsPage() {
  return (
    <>
    <h1>Events page</h1>
    <ul>
      {DUMMY_EVENTS.map((dummy_event) => <li key={dummy_event.id} id={dummy_event.id}>{dummy_event.title}</li>)}
    </ul>
    </>
  )
}
